Reflection

@vscrlsuspicion | “ Love Me; Hate Me” by Visceral Suspicion (2021) | Pen Drawing / Digital Colouring | 1500 x 1500 

“Looking in your mirror what is it you see? Are you wearing rose-coloured glasses or lashing back with sharpened teeth? Are you infatuated with your image? Do you feel a lot like hell? Are you fuelling your fires with love and desire or do you just love to hate yourself? Do you love to love you, baby? Why are you losing sleep? Do you treat yourself vicious, are you feeling auspicious, perhaps your just thinking a little too deep?”
